package com.ufgov.zc.server.zc.service.impl;import java.util.List;import java.util.Map;import com.ufgov.zc.common.system.dto.ElementConditionDto;import com.ufgov.zc.common.zc.model.ZcBAgency;import com.ufgov.zc.server.zc.dao.IZcBAgencyDao;import com.ufgov.zc.server.zc.service.IZcBAgencyService;public class ZcBAgencyService implements IZcBAgencyService {  public IZcBAgencyDao zcBAgencyDao;  public List indexListAgency(ElementConditionDto dto) {    List list = zcBAgencyDao.indexListAgency(dto);    return list;  }  public Integer getAgencyCount(Map parameterObject) {    return zcBAgencyDao.getAgencyCount(parameterObject);  }  public IZcBAgencyDao getZcBAgencyDao() {    return zcBAgencyDao;  }  public void setZcBAgencyDao(IZcBAgencyDao zcBAgencyDao) {    this.zcBAgencyDao = zcBAgencyDao;  }  public ZcBAgency getAgencyById(String code) {    return zcBAgencyDao.getAgencyById(code);  }  public List getAgency(Map parameterObject) {    return zcBAgencyDao.getAgency(parameterObject);  }}